import React from 'react'
import { Route } from 'react-router-dom'
import Home from './Home'
import Login from './Login'

function App(){
    return(
        <div>
            <Route exact path="/home" component={Home} />
            <Route exact path="/" component={Login} />
        
        </div>
    )
}
export default App
